import React, { useState, useEffect } from 'react';
import { } from 'antd';

const Maps = () => {

    useEffect(
        () => {
            // 지도 위치에 따른 데이터 가져와야 해 redux-saga
            const container = document.getElementById("mapContainer");
            let options = {
                center: new window.daum.maps.LatLng(37.5795876, 126.9636324),
                level: 5
            };
            let map = new window.daum.maps.Map(container, options);
        }
    );
    return (
        <div id="mapContainer">

        </div>
    );
};

export default Maps;
